package LeetCode75.SlidingWindow;


public class MaximumNumberOfVowelsInASubstringOfGivenLength {
    public static int maxVowels(String s, int k) {
        int maxCount = 0;
        boolean[] vowels = new boolean['z' + 1];
        vowels['a'] = true;
        vowels['e'] = true;
        vowels['i'] = true;
        vowels['o'] = true;
        vowels['u'] = true;

        int count = 0;
        for (int i = 0; i < k; i++) {
            if (vowels[s.charAt(i)]) count++;
        }
        maxCount = Math.max(count, maxCount);

        for (int i = 1; i < s.length()-k+1; i++) {
            if (vowels[s.charAt(i-1)]) count--;
            if (vowels[s.charAt(i+k-1)]) count++;
            maxCount = Math.max(count, maxCount);
        }

        return maxCount;
    }

    public static void main(String[] args) {
        System.out.println(maxVowels("abciiidef", 3));
        System.out.println(maxVowels("leetcode", 3));
        System.out.println(maxVowels("weallloveyou", 7));
//        String s = "";
//        System.out.println(maxVowels(s, 3945));
    }
}
